import { Routes, Route } from 'react-router-dom';
import DigitalMenu from './DigitalMenu';
import MenuPage from './MenuPage'; // <<< Import here

function App() {
  return (
    <Routes>
      <Route path="/" element={<DigitalMenu />} />
      <Route path="/menu" element={<MenuPage />} /> {/* <<< New route */}
    </Routes>
  );
}

export default App;
